import Carousel from 'react-bootstrap/Carousel';

import b1 from '../pics/main/banner1.png';
import b2 from '../pics/main/banner2.png';
import b3 from '../pics/main/banner3.png';
import b4 from '../pics/main/banner1.png';
import b5 from '../pics/main/banner1.png';
import b6 from '../pics/main/banner1.png';
import b7 from '../pics/main/banner1.png';
import b8 from '../pics/main/banner1.png';
import b9 from '../pics/main/banner1.png';
import b10 from '../pics/main/banner1.png';
import b11 from '../pics/main/banner1.png';
import b12 from '../pics/main/banner1.png';

function Carusel() {
  return (
    <Carousel slide={false}>
      <Carousel.Item>
        <ExampleCarouselImage text="First slide" />
      </Carousel.Item>
      <Carousel.Item>
        <ExampleCarouselImage text="Second slide" />
      </Carousel.Item>
      <Carousel.Item>
        <ExampleCarouselImage text="Third slide" />
      </Carousel.Item>
    </Carousel>
  );
}

export default Carusel;
